import React, { useEffect } from 'react'
import './App.css';
import Signin from './Components/Singin/Signin';
import {Routes, Route, redirect} from 'react-router-dom'
import Items from './Components/Items/Items';
import { useDispatch, useSelector } from 'react-redux';
import axios from 'axios';
import { apis } from './Apis/apis';
import { getUser } from './Slices/usersSlice';
import { getUsersData } from './helpers/getUsersData';
import { filterUsersData } from './helpers/filterUsersData';
import Error from './Components/Error/Error';

const App = () => {
  const dispatch = useDispatch()
  const users = useSelector((state: any) => state.users)
  const currentUser = useSelector((state: any) => state.currentUser)

  useEffect(() => {
    const data = getUsersData(apis.users)
    data.then((response: any) => dispatch(getUser(filterUsersData(response))))
  }, [])

  return (
    <Routes>
      <Route path='/' Component={Signin}/>
      {/* {currentUser.name ? <Route path='/items' Component={Items}/> : <Route path='/items' Component={Error}/>} */}
      {currentUser.name ? <Route path='/items' Component={Items}/> : redirect("/login")}
      <Route path='/items' Component={Error}/>
    </Routes>    
  )
}

export default App
